import React, { Component } from 'react';
import ListUsersComponent from './component/ListUsersComponent';

class KurswatchApp extends Component {
    render() {
        return (<>
              <h1>Kurswatch Application</h1>
              <ListUsersComponent />
              </>
        )
    }
}

export default KurswatchApp
